import React from "react";

const Header = () => {
  return (
    <div className = "header">
        <div className = "wrapper">
        <a className = "nav" href="#">О нас</a>
        <a className = "nav" href="#">Услуги</a>
        <a className = "nav" href="#">Мастера</a>
        <a className = "nav" href="#">Отзывы</a>
        <a className = "nav" href="#">Блог</a>
        </div>
    </div>
  );
};

export default Header;
